  [],\n\t\"num_tags\": 5,\n\t\"name\": \"environmental-pollutants-and-eggshell-thickness-anhingas-and-wading-birds-in-the-eastern-u\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1972 and 1973 we collected 1,339 clutches
  of eggs of anhingas (Anhinga anhinga) and17 species of waders (herons, egrets, bitterns,
  ibises, and storks). We analyzed the eggs fororganochlorine residues and compared
  shell thickness of these eggs and others collected since1946 (and now in museum
  collections) with shell thickness of eggs collected before the widespreaduse of
  organochlorine pesticides.The overall frequency of residue occurrence was higher
  in eggs from the Great Lakes region,then in those from the Northern Atlantic Coast,
  Southern Atlantic Coast, Inland, and Gulf Coastregions. Residue concentrations also
  were usually higher in eggs from the Northern AtlanticCoast and Great Lakes than
  in those from the other three regions, but there was no consistentpattern among
  those three regions. Among species, the highest residue frequencies and concentrationswere
  usually in eggs of great blue herons {Ardea herodias), wood storks (Mycteriaamericana),
  black-crowned night herons (Nycticorax nycticorax), and great egrets (Casmerodiusalbus).
  Lowest frequencies and concentrations were usually in eggs of white ibises (Eudocimusalbus),
  glossy ibises (Plegadis falcinellus), least bitterns {Ixobrychus exilis), green
  herons{Butorides striatus), and yellow-crowned night herons (Nyctanassa violacea).Eggshells
  were significantly thinner in one or more regions for post-1946 samples of anhinga,great
  blue heron, black-crowned night heron, and wood stork. We detected no significant
  changein the other species.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
